import Hero from "./pricing/Hero.js";
import LeftSection from "./LeftSection.js";
import RightSection from "./RightSection.js";
import Universe from "./Universe.js";


function ProductsPage() {
    return ( 
        <div>
            <Hero/>
            <LeftSection/>
            <RightSection/>
            <Universe/>
        </div>
     );
}

export default PricingPage;
